Common pitfalls
Dependency tracking is topological, which means that reactive dependencies (like a Signal) must be accessed (and thus recorded as reactive dependencies) before the listener scope (like the one in a create_effect) returns.

For example, code inside the spawn_local won’t be tracked:

create_effect(move || {
    wasm_bindgen_futures::spawn_local(async move {
        // This scope is not tracked because spawn_local runs on the
        // next microtask tick once the effect closure has returned already.
    };
    // Everything that is accessed until here is tracked.
    // Once this closure returns, nothing is tracked.
});
We’ll find that any Signals we track in the create_effect won’t be tracked properly in the wasm_bindgen_futures::spawn_local, which is often not what’s intended. This problem can be gotten around by accessing reactive dependencies as needed before going into a future, or with this simple fix:

create_effect(move || {
    signal.track(); // Same as calling `.get()` but without returning a value.
    wasm_bindgen_futures::spawn_local(async move {
        // This scope is not tracked because spawn_local runs on the next microtask tick (in other words, some time later).
    };
    // Everything that is accessed until here is tracked. Once this closure returns, nothing is tracked.
});
All we’re doing there is accessing the dependency before we move into the future, which means dependency tracking should work as intended.

